class AdminBodyList extends Component {
    render() {
        return (
            <div className="admin-body">
                <table>
                    <tbody>
                        <tr className="table-header">
                        <th>IMAGE</th>
                <th>NOM</th>
        <th>DATE DE NAISSANCE</th>
        <th>RACE</th>
        <th>SEXE</th>
        <th>VILLE</th>
                        </tr>
                        <tr>
                        <td>IMAGE</td>
                <td>NOM</td>
        <td>DATE DE NAISSANCE</td>
        <td>RACE</td>
        <td>SEXE</td>
        <td>VILLE</td>
                        </tr>


                    </tbody>
        </table>
            </div>
        );
    }
}

export default AdminBodyList;
